// //public routes
// { path: '/login', isPublic: true, component: login },
// { path: '/forgot-password', isPublic: true },

// //authenticated routes
// { path: '/dashboard', component: dashboard }
import Dashboard from './pages/dashboard/Dashboard'
import AddDriver from './pages/driver/AddDriver'
import DriverList from './pages/driver/DriverList.js'


const routes = [
    {
        path: "/dashboard",
        name: "Dashboard",
        icon: "ni ni-chart-pie-35 text-info",
        component: Dashboard
    }, {
        collapse: true,
        name: "Driver",
        state: "testCollapse",
        icon: "ni ni-chart-pie-35 text-info",
        views: [
            {
                path: "/add-driver",
                miniName: "A",
                name: "Add Driver",
                component: AddDriver,
            }, {
                path: "/driver-list",
                name: "Driver List",
                miniName: "L",
                component: DriverList,
            }
        ]
    }, {
        collapse: true,
        name: "Test",
        state: "test2Collapse",
        icon: "ni ni-chart-pie-35 text-info",
        views: [
            {
                path: "/test11",
                name: "Test 1",
                miniName: "T",
                component: Dashboard,
            }, {
                path: "/test12",
                name: "Test 2",
                miniName: "T",
                component: Dashboard,
            }
        ]
    }
]
export default routes;
